import {Link} from "react-router-dom";

class Post extends Component {
    render(){
      return (
        <header>
        <h1>게시판</h1>
        <hr/>
        <Link to="./page/Write">
         <button id ="button1">게시글 작성</button>
        </Link>
         </header>
      );
    }
  }

  export default Post;
